@prefix : <http://www.semanticweb.org/portal#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:Portal a owl:Class ;
    rdfs:subClassOf [ a owl:Restriction ;
                    owl:onProperty :allowsPharmacist ;
                    owl:someValuesFrom :ViewMedicationDispensingHistory
                    ].

:Pharmacist a owl:Class .

:MedicationDispensingHistory a owl:Class .

:allowsPharmacist a owl:ObjectProperty ;
    rdfs:domain :Portal ;
    rdfs:range :Pharmacist .

:ViewMedicationDispensingHistory a owl:ObjectProperty ;
    rdfs:domain :Pharmacist ;
    rdfs:range :MedicationDispensingHistory .
